      onCondAmbienteAgregarFilas: function(resultGroup, aBodyEspecificacion){
        var oThatAmb = this;
        let oUsuariosActualiza = [];
        let oFirstFechActualiza= [];
        resultGroup.forEach( function(oResultData){
          oResultData.forEach( function(oData, index){
            if(index===0){
              aBodyEspecificacion.push([
                {
                  // text: oData.ensayoPadreId ? oData.ensayoPadreId.descripcion : ' ',
                  text: oThatAmb.onValidarInfo(oData, "ensayoPadreId.contenido"),
                  preserveLeadingSpaces: true,
                  style: "tableHeaderEspecificaciones",
                  alignment: 'left',
                  colSpan: 1,
                  border: [true, true, true, false],
                },
                {
                  text: ' ',
                  border: [true, true, true, false],
                },
                {
                  text: ' ',
                  border: [true, true, true, false],
                },
                ],[
                {
                  text: oData.ensayoHijo?oData.ensayoHijo: ' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
                {
                  text: oData.especificacion?oData.especificacion: ' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
                {
                  text: oData.resultados?oData.resultados:' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
              ]);
            } else {
              aBodyEspecificacion.push([
                {
                  text: oData.ensayoHijo?oData.ensayoHijo:' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
                {
                  text: oData.especificacion?oData.especificacion:' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
                {
                  text: oData.resultados?oData.resultados:' ',
                  preserveLeadingSpaces: true,
                  style: "tableData",
                  colSpan: 1,
                  border: [true, false, true, false],
                },
              ]);
            }

            ///  verificado por
            var userActualiza = oThatAmb.onValidarInfo(oData,"usuarioActualiza");
            // var userMultiCheck = oThat.onValidarInfo(oData,"multiCheckUser");
            if(userActualiza != ""){
              oUsuariosActualiza.push(userActualiza);
            }

            /// firstFechaActualiza
            if(oData.firstFechaActualiza){
              oFirstFechActualiza.push(oData.firstFechaActualiza)
            }

          })
        })

        // elimina los duplicados
        let reduceUserData = oUsuariosActualiza.reduce(function (accumulator, curValue) {
          if (accumulator.indexOf(curValue) === -1) {
            accumulator.push(curValue)
          }
          return accumulator
        }, []);

        // join de los usuarios para mostrar en verificado por
        let stringUsersVerificadoPor = reduceUserData.join(",");
        var fechaverif = null;
        if(oFirstFechActualiza.length>0){
          var aSortFechas = oFirstFechActualiza.sort((a, b) => a - b);
          fechaverif = this.onFormatterDate(aSortFechas[0]);
        }

        aBodyEspecificacion.push([
          {
            text: ("VERIFICADO POR: "+(stringUsersVerificadoPor?stringUsersVerificadoPor:"")),
            style: "tableVerify",
            colSpan: 2,
            border: [true, true, true, true],
          },
          {},
          {
            text: ("FECHA: "+(fechaverif?fechaverif:"")),
            style: "tableVerify",
            colSpan: 1,
            border: [true, true, true, true],
          },
        ])

        },

        onValidarInfo: function(aDataEstructuras,Estructura){
          let BusquedaEstructuras = Estructura.split(".");
          let data = aDataEstructuras;
          BusquedaEstructuras.forEach(function(info){
            // var data = aDataEstructuras[info];
            if(data){
              data = data[info];
            }else {
              return '';
            }
          })
          return data? data : '';
        }

